import "bootstrap/dist/css/bootstrap.min.css";
import Logins from "./Logins";
import Dashboard from "./Dashboard";

const code = new URLSearchParams(window.location.search).get("code");

function App() {
  return (
    <div className="App">
      <h1>Hello World</h1>
      {code ? <Dashboard code={code} /> : <Logins />}
    </div>
  );
}

export default App;
